import { useParams } from "react-router-dom";
import { getModule } from "../api";

export default function Module() {
    const { dipId, moduleId } = useParams();

    const { name, desc } = getModule({ dipId, moduleId });
    return (
        <div>
            <h3>{name}</h3>
            <p>{desc}</p>
        </div>
    )
}
